import React from "react";
import "./Country.css";
import { Link } from "react-router-dom";

export default function Country({flag, name, continent,population, id}) {
    return [
        <div className="Country">
            
            <img src={flag} alt="img not found"/>
            <Link to={`/country/${name}`}>
            <a>{name}</a>
            </Link>
            <a>{continent}</a>
            <a>{population}</a>
        </div>
    ]
}
